import "../Font/Font.css";
import "../FormElements/FormElements.css";
import React, { Component } from "react";

import SaveButton from "../FormElements/SaveButton";
import ResetButton from "../FormElements/ResetButton";
import PrintButton from "../FormElements/PrintButton";
import AddCustomButton from "../FormElements/AddCustomButton";
import SearchMoreButton from "../FormElements/SearchMoreButton";
import Quant from "../CustomItem/Quant";
import TripNames from "../CustomItem/TripNames";
import "../Tables/Tables.css";
import { NavLink } from "react-router-dom";
import TripDates from "../TripDetails/TripDates";
import ItemTypes from "./ItemTypes";
import TripTravelers from "../TripDetails/TripTravelers";
import NewItemName from "./NewItemName";
import NewItemBrand from "./NewItemBrand";
import Text from "./Text";




class ItemAdjust extends Component {
  static defaultProps = {
    item: {},
    photo: "",
    thumb: "",
    food_name: "",
    brand_name: "",
    serving_qty: "",
    weightG: "",
    calPs: "",
    calPhG: "",
  };

  render() {
    const item = this.props.selectedItem;

    const trips = this.props.trips;

    const photo = item.photo.thumb;

    const name = item.food_name;

    const brand = !item.brand_name ? "common" : item.brand_name;

    const serving_qty = Math.round(item.serving_qty);

    const weightG = Math.round(item.serving_weight_grams);

    const calPs = Math.round(item.full_nutrients[0].value);

    const calPhG = item.calPhG;

    return (
      <section>
        <div>
          <h2 className="montebello searchResultsTitle white">
            {" "}
            Item details!
          </h2>
        </div>

        <div className="filterButtonContainer tableAdjust">
          <SaveButton />
          <PrintButton />
          <ResetButton />
        </div>
        <form>
          <div className="filterButtonContainer moreContainer">
            <NavLink to={`/add-custom`}>
              <AddCustomButton />
            </NavLink>

            <NavLink to={`/`}>
              <SearchMoreButton />
            </NavLink>
          </div>

          <table id="search-results" className="primaryFont">
            <tbody>
              <tr className="blueBackground white">
                <th className="imageH">
                  <span className="hidden">Image</span>
                </th>
                <th className="itemH">
                  Item<span className="mobile">(Click)</span>
                </th>
                <th className="brandH">Brand</th>
              </tr>

              <tr className="one whiteBackground black">
                <td className="imageH">
                  <img className="tableImage" src={photo} alt="Item" />{" "}
                </td>
                <td className="itemH">{name}</td>
                <td className="brandId">{brand}</td>
              </tr>
            </tbody>
          </table>

          <table id="search-results" className="primaryFont">
            <tbody>
              <tr className="blueBackground white">
                <th className="servingH">
                  Serving Quantity <span className="tableAdjust">(adjust)</span>
                </th>
                <th className="unitH">Unit</th>
                <th className="weightH tooltip gram">Weight (grams)</th>
              </tr>

              <tr className="one whiteBackground black">
                <td className="servingH">
                  {serving_qty}
                  <p className="tableAdjust">
                    <Quant />
                  </p>
                </td>

                <td className="unitH"> {item.serving_unit}</td>

                <td className="weightH tooltip gram">
                  {weightG}
                  <span className="tooltiptext">grams</span>
                  <p className="tableAdjust dataResult blackBackground white">
                    100
                  </p>
                </td>
              </tr>
            </tbody>
          </table>
          <table id="search-results" className="primaryFont">
            <tbody>
              <tr className="blueBackground white">
                <th className="caloriesH cal calS">Calories</th>
                <th className="caloriesH">Calories per 100g</th>
                <th className="addH itemH">Add to pack</th>
              </tr>
              <tr className="one whiteBackground black">
                <td className="caloriesH tooltip cal calS">
                  {" "}
                  {calPs}
                  <span className="tooltiptext">cal per serving</span>
                  <p className="tableAdjust dataResult blackBackground white">
                    100
                  </p>
                </td>

                <td className="caloriesH tooltip calG">{calPhG}</td>

                <td>
                  <span className="add">
                    <TripNames trips={trips} />
                  </span>
                </td>
              </tr>
            </tbody>
          </table>
        </form>
      </section>
    );
  }
}

export default ItemAdjust;
